  null,\n\t\"notes\": \"This excel spreadsheet is the result of merging at the port
  level of several of the in-house fisheries databases in combination with other demographic
  databases such as the U.S. census. The fisheries databases used include port listings,
  weighout (dealer) landings, permit information on homeports and owner cities of
  residence, dealer permit information, and logbook records. The database consolidated
  port names in line with USGS and Census conventions, and corrected typographical
  errors, non-conventional spellings, or other issues.nnEach row is a community, and
  there may be confidential data since not all communities have 3 or more entities
  for the various variables.nn\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
